package main

import (
    "bytes"
    "fmt"
    "io/ioutil"
    "os"
    "compress/zlib"
    b64 "encoding/base64"
    "encoding/json"
)

func decrypt(track string) string {
    var ret string

    for i := 0; i < (len(track)/512); i += 2 {
	if (i+2)*512 < len(track) {
	    ret += track[(i+1) * 512 : (i+2) * 512]
	}
	ret += track[i * 512 : (i+1) * 512]
    }

    return ret
}

func getTrackInfo(enctrack string) {
    trackzlib,err := b64.StdEncoding.DecodeString(enctrack)
    if err != nil {
	fmt.Println("error :(")
	return
    }
    btrackzlib := bytes.NewReader(trackzlib)
    rtrackjson,err := zlib.NewReader(btrackzlib)
    if err != nil {
	fmt.Println("error :(")
	return
    }
    trackjson,err := ioutil.ReadAll(rtrackjson)
    if err != nil {
	fmt.Println("err :(")
	return
    }
    var track map[string]interface{}
    err = json.Unmarshal(trackjson, &track)
    if err != nil {
	fmt.Println("err :(")
	return
    }
    fmt.Println("Got LR track info!")

    fmt.Printf("%10s\t%10s\t%10s\n", "Track", "Creator", "Description")
    fmt.Printf("%10s\t%10s\t%10s\n", track["label"], track["creator"], track["description"])
}

func main() {
    enc_track := ""
    if len(os.Args) < 2 {
	fmt.Println("No track provided...")
    } else {
	if os.Args[1] == "4myEyezOnly" {
	    track := decrypt(enc_track)
	    getTrackInfo(track)
	} else {
	    fmt.Println("Using " + os.Args[1] + "track")
	    data, err := ioutil.ReadFile(os.Args[1]) 
	    if err != nil {
		fmt.Println("bad file...")
		fmt.Println(err)
		return
	    }
	    getTrackInfo(string(data))
	}
    }
}
